import React from "react";
import "./booknow.css";
import { Link } from "react-router";
import Booking from "../pages/Booking";

const Booknow = () => {
    return (
        <div className="booknow">

     <button type="button">
     <Link to="/buchung" element = {<Booking/>}> Jetzt buchen</Link>

     </button>
     </div>
    );
}
export default Booknow;
